import React from "react";
import LeftContentStyle from "./LeftContentStyle"

import LeftList from "./LeftList/LeftList"
import LeftListActive from "./LeftListActive/LeftListActive"


class LeftContent extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          updateList: false,
        };
      }



      render() {
        return (
            <LeftContentStyle>
                <LeftList updateList={this.state.updateList}/>
                <LeftListActive updateList={this.state.updateList}/>
            </LeftContentStyle>
        )
      }
}


export default LeftContent;
